        noop: function() {},
        flattenObject: function (obj) {
            var flatObj = {};
            for (var key in obj) {
                if (obj.hasOwnProperty(key) && typeof obj[key] !== "object") {
                    flatObj[key] = obj[key];
                }
            }
            return flatObj;
        },

